import React, { Component } from "react";
import { Carousel } from "antd";

export class Fade extends Component {
  render() {
    return (
      <Carousel effect="fade">
        <div>
          <h3>1</h3>
        </div>
        <div>
          <h3>2</h3>
        </div>
        <div>
          <h3>3</h3>
        </div>
        <div>
          <h3>4</h3>
        </div>
      </Carousel>
    );
  }
}

export default Fade;
